import ButtonComponent from '../ButtonComponent/ButtonComponent';
import { buttonComponentText, listComponentSpecializeText } from '../../utils/arrays';
import './Specialize.css';
import ListComponentSpecialize from '../ListComponentSpecialize/ListComponentSpecialize';

export default function Specialize() {
    return (
        <section className='specialize'>
            <div className='specialize__block'>
                <h2 className='specialize__title'>
                    Наши работы, на которых мы специализируемся
                </h2>
                <ButtonComponent {...buttonComponentText[1]} />
            </div>
            <ul className='specialize__list'>
                {
                    listComponentSpecializeText.map((block) => (
                        <ListComponentSpecialize key={block.title} {...block} />))
                }
            </ul>
        </section>
    )
}
